(2496, '<p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiR0g3MU1MQ0k5VVl4UG9DcmdlbzdvbSIsInBhc3RlSUQiOjExOTQxOTY4NjMsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space:pre-wrap;\">Мы&nbsp;— это&nbsp;Всероссийское физкультурно-спортивное Общество. И&nbsp;мы&nbsp;за&nbsp;здоровый образ жизни и&nbsp;качественную интересную физическую активность. Мы&nbsp;работаем ради&nbsp;того, чтобы&nbsp;жители нашей страны сформировали привычку постоянно заниматься спортом. Спорт&nbsp;— помогает нам&nbsp;быть здоровыми, а&nbsp;значит увеличивает продолжительность и&nbsp;качество нашей жизни. Хотите яркие и&nbsp;активные будни? Тогда&nbsp;вам&nbsp;к&nbsp;нам.</span><br></p>', 2, 2077, 1, 1, '2022-06-19 10:51:09', '2022-06-19 10:51:31', NULL),
