(2614, '<span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiNUJZd3hYelFpMmtwb1NOOFBLU25vbCIsInBhc3RlSUQiOjE4NzExNzU2NjQsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space:pre-wrap;\">Вы будете чувствовать себя как «эй, я получил это». Все будет организовано в одном месте, вы сможете тренироваться режимно и результативно</span>', 3, 2175, 1, NULL, '2022-07-06 11:27:12', '2022-07-06 11:27:12', NULL),
