(2623, '<strong>Naitre</strong> - это удобный фитнес сервис, который позволяет в одном месте найти все виды тренировок', 3, 2184, 1, NULL, '2022-07-06 12:05:12', '2022-08-11 15:55:32', '2022-08-11 15:55:32'),
(2624, 'Тренировки проходят в режиме реального времени каждый час. Профессиональные сертифицированные тренеры позволяют тренироваться эффективно и безопасно. Достаточно пройти тестирование на сайте, и через несколько минут пользователь', 3, 2185, 1, NULL, '2022-07-06 12:05:12', '2022-08-11 15:55:32', '2022-08-11 15:55:32'),
(2625, 'КАКИЕ ВЫ СТАВИТЕ ЗАДАЧИ? МЫ ПОКАЖЕМ ВАМ, КАК ИХ РЕШИТЬ!', 3, 2186, 1, NULL, '2022-07-06 12:38:19', '2022-08-11 15:55:25', '2022-08-11 15:55:25'),
(2626, 'Не знаете с чего начать? Не беспокойтесь, мы поможем вам разобраться во всем этом!', 3, 2187, 1, NULL, '2022-07-06 12:38:19', '2022-08-11 15:55:25', '2022-08-11 15:55:25'),
(2627, 'Подберем вид тренировки и нагрузку', 3, 2188, 1, NULL, '2022-07-06 12:38:19', '2022-07-06 12:38:19', NULL),
(2628, 'Не уверен, c чего начать? Мы предоставим вам правильное направление. Регулярно тренироваться с помощью персонального графика', 3, 2189, 1, NULL, '2022-07-06 12:38:19', '2022-07-06 12:38:19', NULL),
(2629, 'HoCfUmfCLMnHtxcgRcdezxbVUVfjpbIlPToL7lJz.svg', 3, 2190, 1, 1, '2022-07-06 12:39:15', '2022-07-06 12:39:56', NULL),
(2630, 'Тренеры с опытом работы от 5 лет', 3, 2191, 1, NULL, '2022-07-06 12:40:24', '2022-07-06 12:40:24', NULL),
(2631, 'Независимо от вашего уровня физической подготовки и опыта тренировок, вы сможете эффективно и безопасно тренироваться дома и получить настоящий результат', 3, 2192, 1, NULL, '2022-07-06 12:40:24', '2022-07-06 12:40:24', NULL),
(2632, 'Мгновенный отклик организма', 3, 2193, 1, 1, '2022-07-06 12:40:25', '2022-07-06 12:41:09', NULL),
(2633, 'Сброс лишних килограммов, нормализация веса и формирование желаемых очертаний фигуры, оздоровления организма', 3, 2194, 1, 1, '2022-07-06 12:40:25', '2022-07-06 12:41:09', NULL),
(2634, 'XgMOvP5IOm3U4z7TBl5Ll9FkTR4whrWKkWWI4X65.svg', 3, 2195, 1, 1, '2022-07-06 12:40:39', '2022-07-06 12:41:09', NULL),
(2635, 'W0MKpUWKo0stQ2ii3rggv3KT8kfli8b2dEvsfyot.svg', 3, 2196, 1, 1, '2022-07-06 12:40:39', '2022-07-06 12:41:09', NULL),
(2636, 'Получите тело своей мечты', 3, 2197, 1, NULL, '2022-07-06 12:41:30', '2022-07-06 12:41:30', NULL),
(2637, 'Фитнес тренировки никогда не были так востребованы. Узнайте все, что вам нужно, чтобы трансформировать свое тело на новый уровень', 3, 2198, 1, NULL, '2022-07-06 12:41:30', '2022-07-06 12:41:30', NULL),
(2638, 'WjofSagFS0hqOvsJQLrrdrjZoYbJmueLZMcuCIKk.svg', 3, 2199, 1, 1, '2022-07-06 12:41:42', '2022-07-06 12:42:01', NULL),
(2639, 'ОРГАНИЗАЦИЯ ВСЕГО ТРЕНИРОВОЧНОГО ПРОЦЕССА', 3, 2200, 1, NULL, '2022-07-06 12:58:55', '2022-08-11 15:55:29', '2022-08-11 15:55:29'),
(2640, '<p>Мы предоставляем вам сервис для удаленных тренировок; мы адаптировали популярные и результативные тренировки для дома. NAITRE показывает пользователям, как они могут тренироваться удаленно, с любого рабочего места, в любое время и в любом месте</p>', 3, 2201, 1, 1, '2022-07-06 12:58:55', '2022-08-11 15:55:29', '2022-08-11 15:55:29'),
(2641, '/methods', 3, 2202, 1, 1, '2022-07-06 12:58:55', '2022-08-11 15:55:29', '2022-08-11 15:55:29'),
(2642, 'UhKxlL0wginQ0k6wriHBibohWpNJg6TbbJEaupdz.jpg', 3, 2203, 1, NULL, '2022-07-06 12:58:56', '2022-08-11 15:55:29', '2022-08-11 15:55:29'),
(2643, 'ЛУЧШИЕ СИСТЕМЫ ТРЕНИРОВОК', 3, 2204, 1, NULL, '2022-07-06 13:43:01', '2022-08-11 15:55:36', '2022-08-11 15:55:36'),
(2644, 'IU72vS1HAm4tnOFGJNVSBgE7GMdQM0knX7usoK4V.jpg', 3, 2205, 1, NULL, '2022-07-06 13:43:01', '2022-08-11 15:55:36', '2022-08-11 15:55:36'),
(2645, 'ЖИРОСЖИГАНИЕ', 3, 2206, 1, NULL, '2022-07-06 13:43:01', '2022-07-06 13:43:01', NULL),
(2646, '<p>Освойте технику интервальных, функциональных и кардио тренировок. Эти тренировки подготовят ваш организм к созданию красивой фигуры, а затем к созданию тела вашей мечты</p>', 3, 2207, 1, NULL, '2022-07-06 13:43:01', '2022-07-06 13:43:01', NULL),
(2647, 'ИНТЕРВАЛЬНАЯ <br>ФУНКЦИОНАЛЬНАЯ <br>КАРДИО', 3, 2208, 1, NULL, '2022-07-06 13:43:01', '2022-07-06 13:43:01', NULL),
(2648, 'ОЗДОРОВЛЕНИЕ', 3, 2209, 1, NULL, '2022-07-06 13:44:34', '2022-07-06 13:44:34', NULL),
(2649, '<p>Используя за основу эти виды тренировок, они подготовят Вас к созданию базовых навыков, которые позволят быстро развивать Ваше тело. Эти тренировки отличное введение в мир фитнеса</p>', 3, 2210, 1, NULL, '2022-07-06 13:44:34', '2022-07-06 13:44:34', NULL),
(2650, 'РАСТЯЖКА | ПИЛАТЕС <br>ЙОГА | ДЫХАТЕЛЬНАЯ <br>ГИМНАСТИКА', 3, 2211, 1, NULL, '2022-07-06 13:44:34', '2022-07-06 13:44:34', NULL),
(2651, 'УКРЕПЛЕНИЕ', 3, 2212, 1, NULL, '2022-07-06 13:44:34', '2022-07-06 13:44:34', NULL),
(2652, '<p>Используя за основу эти виды тренировок, они подготовят Вас к созданию базовых навыков, которые позволят быстро развивать Ваше тело. Эти тренировки отличное введение в мир фитнеса</p>', 3, 2213, 1, NULL, '2022-07-06 13:44:34', '2022-07-06 13:44:34', NULL),
(2653, 'КРУГОВАЯ | ABS <br>ФУНКЦИОНАЛЬНАЯ <br>ПОДВИЖНОСТЬ', 3, 2214, 1, NULL, '2022-07-06 13:44:34', '2022-07-06 13:44:34', NULL),
(2654, 'МЫ СОЗДАЛИ NAITRE ДЛЯ ЭФФЕКТИВНЫХ ТРЕНИРОВОК ДОМА', 3, 2215, 1, NULL, '2022-07-06 13:50:14', '2022-08-11 15:55:39', '2022-08-11 15:55:39'),
(2655, 'Мы работали над созданием в течение 5 лет. Мы знаем, что для этого нужно, мы делаем это каждый день, и мы встроили эти знания в Naitre. Десятки тысяч людей полагаются на Naitre каждый день.', 3, 2216, 1, NULL, '2022-07-06 13:50:14', '2022-08-11 15:55:39', '2022-08-11 15:55:39'),
(2656, 'Пришло время начать инвестировать в себя!', 3, 2217, 1, NULL, '2022-07-06 13:50:14', '2022-08-11 15:55:39', '2022-08-11 15:55:39'),
(2657, 'Потому, что тренировки дома могут быть самым простым способом изменить ваше тело!', 3, 2218, 1, NULL, '2022-07-06 13:50:14', '2022-08-11 15:55:39', '2022-08-11 15:55:39'),
(2658, 'qmSch9SL1QL5nKEjawSEZDp3JKNLl7Lnn9KjYCjB.jpg', 3, 2219, 1, NULL, '2022-07-06 13:50:14', '2022-08-11 15:55:39', '2022-08-11 15:55:39'),
(2659, 'УМНЫЕ ДВИЖЕНИЯ СПОСОБНЫ ПОДГОТОВИТЬ <span>ФУНКЦИОНАЛЬНОЕ ТЕЛО К ПОВСЕДНЕВНЫМ УСЛОВИЯМ</span>', 3, 2220, 1, NULL, '2022-07-07 08:13:20', '2022-08-11 15:55:44', '2022-08-11 15:55:44'),
(2660, '<p>Наш метод основан на обеспечении  безопасного выполнение упражнений. Несмотря на огромное разнообразие возможных комбинаций упражнений, доступные тренировки подразделены на главные группы:</p>\r\n<ul>\r\n<li>освоение техники относительно простых упражнений</li>\r\n<li>освоении техники координационно сложных упражнений</li>\r\n<li>совершенствование техники упражнения</li>\r\n<li>улучшение физических качеств и способностей</span></li>\r\n<li>улучшение функциональной подготовки</li>\r\n</ul>', 3, 2221, 1, NULL, '2022-07-07 08:13:20', '2022-08-11 15:55:44', '2022-08-11 15:55:44'),
(2661, 'НАШИ РУКОВОДЯЩИЕ  ПРИНЦИПЫ', 3, 2222, 1, NULL, '2022-07-07 08:34:18', '2022-08-11 15:55:47', '2022-08-11 15:55:47'),
(2662, 'eWvEXINQjFJTUtvuig6lMDU9EuDDGdzwRkp2QrMF.jpg', 3, 2223, 1, NULL, '2022-07-07 08:34:18', '2022-08-11 15:55:47', '2022-08-11 15:55:47'),
(2663, 'Тренироваться <br>функционально', 3, 2224, 1, 1, '2022-07-07 08:34:18', '2022-07-07 08:55:47', NULL),
(2664, 'с безопасными упражнениями', 3, 2225, 1, NULL, '2022-07-07 08:34:18', '2022-07-07 08:34:18', NULL),
(2665, 'Заниматься <br>сознательно', 3, 2226, 1, 1, '2022-07-07 08:34:18', '2022-07-07 08:55:47', NULL),
(2666, 'постепенное достижение цели', 3, 2227, 1, NULL, '2022-07-07 08:34:18', '2022-07-07 08:34:18', NULL),
(2667, 'Тренироваться <br>функционально', 3, 2228, 1, 1, '2022-07-07 08:34:18', '2022-07-07 08:55:47', NULL),
(2668, 'статодинамическое позиционирование', 3, 2229, 1, NULL, '2022-07-07 08:34:18', '2022-07-07 08:34:18', NULL),
(2669, 'Активные движения <br>и вращения', 3, 2230, 1, 1, '2022-07-07 08:34:18', '2022-07-07 08:55:47', NULL),
(2670, 'технически точное выполнение', 3, 2231, 1, NULL, '2022-07-07 08:34:18', '2022-07-07 08:34:18', NULL),
(2671, 'Системные <br>тренировки', 3, 2232, 1, 1, '2022-07-07 08:34:18', '2022-07-07 08:55:47', NULL),
(2672, 'для неприрывного результата', 3, 2233, 1, NULL, '2022-07-07 08:34:18', '2022-07-07 08:34:18', NULL),
(2673, 'Начинайте <br>осознанно', 3, 2234, 1, 1, '2022-07-07 08:34:18', '2022-07-07 08:55:47', NULL),
(2674, 'тренироваться вдумчиво', 3, 2235, 1, NULL, '2022-07-07 08:34:18', '2022-07-07 08:34:18', NULL),
(2675, 'как работает naitre', 3, 2236, 1, NULL, '2022-07-07 09:41:02', '2022-08-11 15:55:49', '2022-08-11 15:55:49'),
(2676, '<p><span>Naitre</span> -  это лучший способ тренироваться эффективно дома. Люди, которые переключаются на Naitre, более продуктивны и лучше организованы. Они эффективнее тренируются и затрачивают меньше времени. Вот как Naitre делает это возможным. Придерживайтесь рекомендаций сервиса,  которые предоставленны на основаннии вашей анкеты. Рекомендации содержат в себе все, что связано с поставленной целью; какие виды тренировок посещать, сколько раз в неделю, в какой последовательности, рекомендации по нагрузке и пульсовым зонам на тренировке. Вся информация хранится в личном кабинете.</p>', 3, 2237, 1, 1, '2022-07-07 09:41:02', '2022-08-11 15:55:49', '2022-08-11 15:55:49'),
(2677, '«Бесплатный период» в Naitre позволяет увидеть все, что мы предоставляем.', 3, 2238, 1, NULL, '2022-07-07 09:41:02', '2022-08-11 15:55:49', '2022-08-11 15:55:49'),
(2678, 'Настройте свое тренировочное пространство 2*1.5 м и придерживайтесь рекомендаций сервиса', 3, 2239, 1, NULL, '2022-07-07 09:41:02', '2022-08-11 15:55:49', '2022-08-11 15:55:49'),
(2679, 'Присоединяйтесь к Naitre <br>и начните тренироваться дома', 3, 2240, 1, 1, '2022-07-07 09:41:02', '2022-08-11 15:55:49', '2022-08-11 15:55:49'),
