(2687, '<p>В расписании тренировок представлены самые популярные и результативные направления в области фитнеса, которые адаптированы для эффективных и безопасных тренировок дома. Сделайте эти тренировки где угодно и когда угодно</p>', 3, 2248, 1, NULL, '2022-07-09 10:20:38', '2022-08-11 15:55:59', '2022-08-11 15:55:59'),
(2688, '<strong>Расписание </strong> тренировок', 3, 2249, 1, 1, '2022-07-09 10:20:38', '2022-08-11 15:55:59', '2022-08-11 15:55:59'),
(2689, 'IdHOFVHaXsOsfTUULdFy0APTfnGwJgIiLmgF9R2i.png', 3, 2250, 1, NULL, '2022-07-09 10:20:38', '2022-08-11 15:55:59', '2022-08-11 15:55:59'),
