(2691, 'Вы можете изменить период списания или продлить подписку', 3, 2252, 1, NULL, '2022-07-15 07:24:33', '2022-08-11 15:56:02', '2022-08-11 15:56:02'),
(2692, 'FAQ', 3, 2253, 1, NULL, '2022-07-15 10:12:33', '2022-08-11 15:56:04', '2022-08-11 15:56:04'),
(2693, 'Сайт рыбатекст поможет дизайнеру, верстальщику, вебмастеру сгенерировать', 3, 2254, 1, NULL, '2022-07-15 10:34:26', '2022-07-15 10:34:26', NULL),
(2694, '<p>Сайт рыбатекст поможет дизайнеру, верстальщику, вебмастеру сгенерировать несколько абзацев более менее осмысленного текста рыбы на русском языке, а начинающему оратору отточить навык публичных выступлений в домашних условиях. При создании генератора мы использовали небезизвестный универсальный код речей. Текст генерируется абзацами случайным образом</p>', 3, 2255, 1, NULL, '2022-07-15 10:34:26', '2022-07-15 10:34:26', NULL),
(2695, 'Сайт рыбатекст поможет дизайнеру, верстальщику, вебмастеру сгенерировать', 3, 2256, 1, NULL, '2022-07-15 11:40:23', '2022-07-15 11:40:23', NULL),
