(2790, '<p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiOUd4amtqYk4zbXptc1E1clYwNzZaNCIsInBhc3RlSUQiOjE1NjAwNDIzMzksImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space:pre-wrap;\"><b>Остановочные павильоны нового образца в комплекте с комплексом устройств беспроводной связи и видеонаблюдения и прочие элементы комплексного благоустройства остановочных пунктов</b></span></p><p><span style=\"white-space:pre-wrap;\">Павильон ожидания (остановочный павильон, автопавильон) предназначен для временного укрытия пассажиров, ожидающих прибытия наземного городского транспорта, от воздействия неблагоприятных погодных факторов.</span></p><p><span style=\"white-space:pre-wrap;\">Павильоны ожидания и все элементы благоустройства выполняются в соответствии с требованиями технического задания, утвержденного в 2020 году руководителем Департамента транспорта и развития дорожно-транспортной инфраструктуры города Москвы М.С. Ликсутовым (№17-17-5/20 от 10.01.2020)</span></p><p><span style=\"white-space:pre-wrap;\">Прежнее техническое задание:  ДТиРДТИ 2019 года от 07.03.2019 года № 17-19-772/7.  </span></p>', 3, 2351, 1, NULL, '2022-08-22 07:28:30', '2022-08-22 07:28:30', NULL),
(2791, 'VyORsintLGcFFXiWTOsMutU6M3oZr8QOGbM8u3Xh.png', 3, 2352, 1, 1, '2022-08-22 07:28:30', '2022-08-22 07:33:21', NULL),
(2792, 'Павильоны ожидания', 3, 2353, 1, NULL, '2022-08-22 07:38:04', '2022-08-22 07:38:04', NULL),
(2793, 'Получить коммерческое предложение', 3, 2354, 1, NULL, '2022-08-22 07:54:14', '2022-08-22 07:54:14', NULL),
(2794, 'Оставьте свои контактніе данные и мы вышлем вам условия сотрудничества.', 3, 2355, 1, NULL, '2022-08-22 07:54:14', '2022-08-22 07:54:14', NULL),
(2795, 'Автономный павильон ожидания пассажирского транспорта', 3, 2356, 1, NULL, '2022-08-22 08:10:25', '2022-08-22 08:10:25', NULL),
(2796, 'Наша компания разработала уникальный автономный павильон ожидания пассажирского транспорта, закрытой сбоку, снабженной автономной системой электроснабжения на основе солнечной фотоэлектрической установки, и может применяться в районах ненадежного и децентрализованного электроснабжения.', 3, 2357, 1, NULL, '2022-08-22 08:10:25', '2022-08-22 08:10:25', NULL),
(2797, 'Заказать консультацию', 3, 2358, 1, NULL, '2022-08-22 08:10:25', '2022-08-22 08:10:25', NULL);
INSERT INTO `block_content_translations` (`id`, `value`, `lang_id`, `block_content_id`, `admin_created_id`, `admin_updated_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(2798, '<p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiOUd4amtqYk4zbXptc1E1clYwNzZaNCIsInBhc3RlSUQiOjg0ODM0MzAzNiwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space:pre-wrap;\">Автономный павильон ожидания пассажирского транспорта содержит каркас, выполненный в виде рамной конструкции, в которой установлены стеновые панели, с закрепленными на них нижними информационными панелями, а на боковых опорах закреплена кровля с установленными на ней светодиодным светильником, фотоэлектрической панелью и верхней информационной панелью. При этом фотоэлектрическая панель подключена к входу контроллера заряда, выполненному с возможностью его подключения к электрической сети общего пользования, выход которого подключен к входу аккумуляторной батареи, выход которой через инвертор подключен к блоку питания автономного павильона, при этом выходы блока питания подключены к разъемам питания светодиодного светильника и элементов подсветки нижних информационных панелей, к разъему питания верхней информационной панели, а также к блоку управления павильона. Павильон снабжен IP-камерами, подключенными к Wi-Fi- роутеру, GSM-модемом, тревожной кнопкой, акустическим датчиком, датчиком движения и фотоэлектрическим датчиком, подключенными к блоку управления, при этом силовые выходы блока управления подключены к линиям коммутатора, управляющим включением светодиодного светильника, элементов подсветки нижних информационных панелей, а также активацией верхней информационной панели, к информационному входу которой дополнительно подключен информационный выход блока управления.</span></p><p><span style=\"white-space:pre-wrap;\">Положительным техническим результатом, обеспечиваемым раскрытой выше совокупностью конструктивных признаков павильона, является возможность его использования в качестве остановки общественного транспорта в районах с ненадежным электроснабжением, за счет применения в конструкции павильона фотоэлектрических панелей и аккумуляторной батареи, обеспечивающих автономное питание электропотребляющих узлов павильона, при этом экономный расход электроэнергии обеспечивается применением фотоэлектрического датчика. Кроме того, применение в конструкции павильона камер, датчиков, обнаруживающих движение, информационных панелей и тревожной кнопки обеспечивает повышение безопасности использования павильона, за счет возможности удаленного наблюдения за остановкой общественного транспорта с помощью камер, возможности быстрого сообщения об опасных событиях за счет применения тревожной кнопки, а также возможности выдачи предупреждающих сообщений на информационные панели и оповещения пассажиров о чрезвычайных ситуациях.</span></p><p><span style=\"white-space:pre-wrap;\"><b>Дополнительную информацию и консультацию можно получить по телефонам:</b></span></p><p><span style=\"white-space:pre-wrap;\"><b>+7 (495) 662-50-01 (доб. 404) – Константин</b></span></p><p><span style=\"white-space:pre-wrap;\"><b>E-mail: info@stkomplex.ru</b></span></p>', 3, 2359, 1, NULL, '2022-08-22 08:10:25', '2022-08-22 08:10:25', NULL);
