(96, 'Сборная России одержала вторую победу на «Интеркап 2021»', 29, 'App\\Models\\ModuleItem', 74, 1, NULL, '2022-06-19 08:10:27', '2022-06-19 08:10:27', NULL),
(97, '22 апреля 2021', 29, 'App\\Models\\ModuleItem', 75, 1, NULL, '2022-06-19 08:10:27', '2022-06-19 08:10:27', NULL);
INSERT INTO `module_item_properties` (`id`, `value`, `properable_id`, `properable_type`, `module_attribute_id`, `admin_created_id`, `admin_updated_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(98, '<p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiR0g3MU1MQ0k5VVl4UG9DcmdlbzdvbSIsInBhc3RlSUQiOjEzODMzMTYyOTQsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space:pre-wrap;\">В&nbsp;четверг, 22-го апреля, сборная России одержала вторую победу на&nbsp;международном турнире «Интеркап 2021». Со&nbsp;счётом 8:2&nbsp;наши парни обыграли столичный ЦСКА. Хет-триком в&nbsp;команде Михаила Лихачёва отметился Фёдор Земсков. Дубль на&nbsp;счёту Андрея Новикова. Ещё&nbsp;по&nbsp;мячу забили Максим Чужков, Борис Никоноров и&nbsp;Алексей Макаров.</span></p><p><span style=\"white-space:pre-wrap;\">В&nbsp;пятницу, 23-го апреля, сборная России сыграет заключительный матч на&nbsp;групповом этапе текущих соревнований. Соперником наших парней будет обладатель Кубка России питерский «Кристалл». Начало встречи&nbsp;— 19:45.<br></span></p><p><span style=\"white-space:pre-wrap;\">Санкт-Петербург. Интеркап 2021. ДС&nbsp;«Динамит» </span></p><p><span style=\"white-space:pre-wrap;\">ЦСКА (Москва) — Россия&nbsp;— 2:8 (1:3, 1:2, 0:0).</span></p><p><span style=\"white-space:pre-wrap;\">Голы: Земсков (3), Новиков (2), Никоноров, Чужков, Макаров&nbsp;— Колбанов, Медведев.</span></p><p><span style=\"white-space:pre-wrap;\">Михаил Лихачёв, главный тренер сборной России.</span></p><ul><li><span style=\"white-space:pre-wrap;\">Сегодня играли с&nbsp;ЦСКА. Понятно, что&nbsp;мы&nbsp;были фаворитами этой встречи. Наверное, те&nbsp;ожидания, которые у&nbsp;меня были перед&nbsp;матчем, оправдались. Для&nbsp;себя отметил моменты и&nbsp;со&nbsp;знаком плюс, и&nbsp;со&nbsp;знаком минус. Пожалуй, для&nbsp;нас&nbsp;получилась не&nbsp;очень сложная игра. Мы&nbsp;быстро повели в&nbsp;счёте, но&nbsp;все&nbsp;равно в&nbsp;таких встречах частенько по&nbsp;ходу поединка теряется концентрация, что, на&nbsp;данный момент, является нашей проблемой, но&nbsp;мы&nbsp;разберёмся, сделаем выводы. По&nbsp;факту у&nbsp;нас&nbsp;сейчас шесть очков, но&nbsp;по&nbsp;счёту эти&nbsp;две встречи мы&nbsp;сыграли лучше, чем&nbsp;по&nbsp;качеству нашей игры\r\n</span></li><li><span style=\"white-space:pre-wrap;\">Если&nbsp;вспоминать вчерашний матч, какие сложности возникли в&nbsp;первом периоде?\r\n</span></li><li><span style=\"white-space:pre-wrap;\">С&nbsp;первых минут игра не&nbsp;заладилась. Непонятно, почему это&nbsp;происходило. Мы&nbsp;были неплохо сконцентрированы, но&nbsp;первый период у&nbsp;нас&nbsp;абсолютно не&nbsp;получился. Во&nbsp;втором стали играть получше, третий провели достаточно прилично. Разобрали ошибки, нашли моменты, которые нужно совершенствовать. В&nbsp;первой встрече не&nbsp;было той&nbsp;целостности, которую мы&nbsp;бы&nbsp;хотели видеть.\r\n</span></li><li><span style=\"white-space:pre-wrap;\">Пятничный матч станет принципиальным для&nbsp;Дмитрия Шишина?\r\n</span></li><li><span style=\"white-space:pre-wrap;\">Да, он&nbsp;будет максимально мотивирован, что, конечно, должно быть в&nbsp;каждом матче у&nbsp;профессионального футболиста. Он&nbsp;будет стараться показать себя с&nbsp;самой лучшей стороны. «Кристалл» - очень хорошая команда. Как&nbsp;сказал Анжело Ширинци, самая профессиональная в&nbsp;мировом пляжном футболе. \r\n</span></li><li><span style=\"white-space:pre-wrap;\">Кто&nbsp;главные соперники сборной России в&nbsp;борьбе за&nbsp;главный трофей турнира?\r\n</span></li><li><span style=\"white-space:pre-wrap;\">Все&nbsp;коллективы очень сильные. Накануне достойно сыграли «Локомотив» с&nbsp;«Дельтой». Сборная Белоруссии уже&nbsp;выглядит полноценно вкатившейся в&nbsp;сезон. Ребята провели большое количество сборов. Мы&nbsp;сумеем подвести итоги по&nbsp;окончании встреч группового этапа. Посмотрим, кто&nbsp;выйдет в&nbsp;полуфинал, не&nbsp;люблю делать прогнозы. Однако, мне&nbsp;кажется, сборная Белоруссии здесь является одним из&nbsp;фаворитов.</span><br></li></ul>', 29, 'App\\Models\\ModuleItem', 76, 1, 1, '2022-06-19 08:10:27', '2022-06-19 08:50:04', NULL);
