INSERT INTO `module_item_properties` (`id`, `value`, `properable_id`, `properable_type`, `module_attribute_id`, `admin_created_id`, `admin_updated_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(114, '<p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiR0g3MU1MQ0k5VVl4UG9DcmdlbzdvbSIsInBhc3RlSUQiOjEwMzM0ODUyMTMsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space:pre-wrap;\">С&nbsp;23&nbsp;по&nbsp;25&nbsp;апреля представители 42&nbsp;российских организаций поборются за&nbsp;призовые места. Спортивные встречи пройдут на&nbsp;трёх питерских площадках: в&nbsp;центре футбольной подготовки «Восхождение» и&nbsp;на&nbsp;Аренах «Топ-спин» и&nbsp;«Urbo». Организаторами мероприятия выступает Всероссийское физкультурно-спортивное общество «Трудовые резервы» при&nbsp;поддержке Министерства спорта Российской Федерации.</span></p><p><span style=\"white-space:pre-wrap;\">16&nbsp;дисциплин, включая сдачу норм ГТО, позволят выявить победителей в&nbsp;командном, общекомандном и&nbsp;личном зачётах. В&nbsp;первый день игр&nbsp;пройдут соревнования по&nbsp;настольному теннису. На&nbsp;второй день, выпадает основная часть соревнований&nbsp;— участники сыграют в&nbsp;футбол, баскетбол, волейбол, дартс и&nbsp;многое другое. Также&nbsp;посоревнуются в&nbsp;перетягивании каната и&nbsp;подтягиваниях. В&nbsp;последний день игр&nbsp;участники проявят себя в&nbsp;интеллектуальных видах спорта&nbsp;— шахматах, шашках и&nbsp;нардах.<br></span></p><p><span style=\"white-space:pre-wrap;\">Церемония открытия пройдёт в&nbsp;центре футбольной подготовки «Восхождение». Для&nbsp;участников и&nbsp;гостей подготовлена яркая шоу-программа открытия игр, которая состоится в&nbsp;субботу, 24&nbsp;апреля, в&nbsp;9:15&nbsp;по&nbsp;московскому времени. Профессиональный ведущий и&nbsp;чирлидеры начнут соревнования с&nbsp;массовой зарядки. \r\n</span></p><p><span style=\"white-space:pre-wrap;\">Участие в&nbsp;корпоративных играх примут 42&nbsp;компании, среди которых 19&nbsp;предприятий Госкорпорации «Ростех», АО&nbsp;«РЭП&nbsp;Холдинг», АО&nbsp;«Авиакомпания „Россия“ и&nbsp;многие другие. Заявку с&nbsp;самым большим количеством участников подал „Профсоюз работников жизнеобеспечения Санкт-Петербурга и&nbsp;Ленинградской области“ - 209&nbsp;человек.\r\n</span></p><p><span style=\"white-space:pre-wrap;\">В&nbsp;завершении трёх игровых дней победителей наградят комплектами медалей, дипломами и&nbsp;уникальными кубками „Трудовых резервов“. Мероприятие пройдёт в&nbsp;рамках реализации задачи федерального проекта „Спорт-норма жизни“ Национального проекта „Демография“ - вовлечение населения в&nbsp;массовый спорт и&nbsp;здоровый образ жизни. Напомним, такое поручение дал&nbsp;Президент Российской Федерации Владимир Путин.</span><br></p>', 33, 'App\\Models\\ModuleItem', 80, 1, NULL, '2022-06-19 09:39:48', '2022-06-19 09:39:48', NULL);
