INSERT INTO `module_item_properties` (`id`, `value`, `properable_id`, `properable_type`, `module_attribute_id`, `admin_created_id`, `admin_updated_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(125, '<p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiNUJZd3hYelFpMmtwb1NOOFBLU25vbCIsInBhc3RlSUQiOjY3ODExMjA5NiwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space:pre-wrap;\">Umped up - это созданный алгоритм тренировки методистами Naitre, для создания условий расщепления жира, для среднеподготовленных людей. </span></p><p><span style=\"white-space:pre-wrap;\">Интервальяная кардио тренировка, чередование интервалов высокой и низкой интенсивности физических нагрузок. Сами интервалы нагрузки  измеряются периодами времени или расстоянием. </span></p><p><span style=\"white-space:pre-wrap;\">Основным показателем нагрузки является пульс. Организм начнет сжигать жир только при частоте сердечных сокращений 65-75 % от максимального значения, когда ваш сердечный ритм превышает 85% в течение более половины продолжительности занятия. Как правило, 30 минут-это максимальное количество времени, которое люди могут качественно выполнять высокоинтервальную тренировку. Интенсивная работа в течение короткого периода времени вызывает так называемую реакцию EPOC (избыточное потребление кислорода после тренировки), которая повышает скорость метаболизма и позволяет нам сжигать больше калорий еще в течение нескольких часов после тренировки.  </span></p><p><span style=\"white-space:pre-wrap;\">Высокоинтервальные тренировки является самой эффективной тренировкой для сжигания жира. Идеальные результаты высокоинтервальной тренировки можно получить при 30-40 минутах  занятия дважды в неделю. </span></p><p><span style=\"white-space:pre-wrap;\">Naitre предлагает своим клиентам  на регулярной основе, сбалансированную, хорошо продуманную тренировку, которая гарантирует результат</span><br></p>', 35, 'App\\Models\\ModuleItem', 101, 1, NULL, '2022-07-07 05:52:57', '2022-07-07 05:52:57', NULL);
